import './LoginHelp.css';

const LoginHelp = () => {
    return (
        <>
            <header className='register-header'>
                <Link to='/'>
                    <h1 className='logo'>Title</h1>
                </Link>
                <Link to='/login'>
                    <button>Sign In</button>
                </Link>
            </header>
        </>
    );
}

export default LoginHelp;
